import React from 'react';
import CollectionCards from '../components/collectionCards/collectionCards';
import Header from '../components/header';
import API_MOVIES from '../API/moviesServise';

let data = [];
const Movies = async () => {
  try {
    
  const getMovies = async () => {
    data = await API_MOVIES.foundMovies({ name: '' });
  };
  } catch (error) {
    console.log(error);
  }
  console.log(data);
  // if (!data) {
  //   getMovies();
  //   console.log(data);
  // }
  return (
    <React.Fragment>
      <Header />
      <CollectionCards data={data} />
    </React.Fragment>
  );
};

export default Movies;
